ISLAMABAD, Feb 9 (APP):Independent candidate Arshad Ali has won the Khyber Pakhtunkhwa Assembly election from PK-63, Charsadda-II by securing 34,395 votes.
According to unofficial result issued by the Returning Officer/ECP, his runner up was ANP candidate Shakeel Bashir Khan who bagged 23,423 votes.
